        $grid11 = $(".grid11");
    var gridx5Width = gridx4Width = gridx3Width = 0;

    onReload();
    $grid.on( 'layoutComplete', onReload );

    $( window ).resize(function() {
        $grid.on( 'layoutComplete', onReload );
    });

    function onReload(event, items) {
        var units = 0;
        var screenWidth = $(".image-grids .rog-inner").width();
        var itemsPosX = new Array;
        var itemsPosY = new Array;
        $(".image-grids").removeClass("screen-l")
            .removeClass("screen-m")
            .removeClass("screen-s")
            .removeClass("screen-ss");

        gridx5Width = 1560;
        gridx4Width = 1200;
        gridx3Width = 944;

        if(screenWidth>=gridx5Width){
            $(".image-grids").addClass("screen-l");
            units = (screenWidth/5);
            if(units>320)
                units=320;

            itemsPosX = [0,3,4,3,4,0,2,0,1,2,3]; //left
            itemsPosY = [0,0,0,1,1,2,2,3,3,3,2]; //top
            height = 4;
        }
        else if(screenWidth>=gridx4Width){
            $(".image-grids").addClass("screen-m");
            units = (screenWidth/4);
            itemsPosX = [0,3,3,0,1,2,0,0,3,3,1];
            itemsPosY = [0,0,1,2,2,2,3,4,3,4,3];
            height = 5;
        }
        else if(screenWidth>=gridx3Width){
            $(".image-grids").addClass("screen-s");
            units = (screenWidth/3);
            itemsPosX = [0,2,2,0,1,1,2,0,2,2,0];
            itemsPosY = [0,0,1,2,2,3,2,3,4,5,4];
            height = 6;
        }
        else{
            $(".image-grids").addClass("screen-ss");
            units = (screenWidth/2);
            itemsPosX = [0,0,1,0,1,0,0,0,0,1,0];
            itemsPosY = [0,2,2,3,3,6,7,10,8,7,4];
            height = 12;
        }

        gridsPos(units,height,itemsPosX,itemsPosY);
        grids11fix(screenWidth,units);
        /*
         $('.image-grids .rog-inner').css("height", units*height);
         $('.image-grids .rog-inner').css("min-height", units*height);
         $('.image-grids .rog-inner').css("max-height", units*height);
         */
    }

    function grids11fix(screen,minWidth){
        var screenWidth = screen;
        var units = minWidth;
        var $grid62 = $(".grid6-2");

        gridx5Width = 1560;
        gridx4Width = 1200;
        gridx3Width = 944;

        if( $(".image-grids").hasClass("grids11") ){
            if(screenWidth>=gridx5Width){
                $grid62.css({ "left": units, "top": units*2});
            }
            else if(screenWidth>=gridx4Width){
                $grid62.css({ "left": units*3, "top": units*2});
            }
            else if(screenWidth>=gridx3Width){
                $grid62.css({ "left": units*2, "top": units*3});
            }
            else{
                $grid6.css("top",units*4);
                $grid62.css("top",units*6);
                $grid8.css("top",units*8);
                $grid8.css("top",units*10);
                $grid9.css("top",units*12);
                $grid10.css("top",units*14);
                $grid11.css("top",units*16);
                $('.image-grids .rog-inner').css("height", units*18);
                $('.image-grids .rog-inner').css("min-height", units*18);
                $('.image-grids .rog-inner').css("max-height",units*18);
            }
        }

    }

    function gridsPos(units,height,posX,posY){
        $grid1.css({ "left": units*posX[0], "top": units*posY[0]});
        $grid2.css({ "left": units*posX[1], "top": units*posY[1]});
        $grid3.css({ "left": units*posX[2], "top": units*posY[2]});
        $grid4.css({ "left": units*posX[3], "top": units*posY[3]});
        $grid5.css({ "left": units*posX[4], "top": units*posY[4]});
        $grid6.css({ "left": units*posX[5], "top": units*posY[5]});
        $grid7.css({ "left": units*posX[6], "top": units*posY[6]});
        $grid8.css({ "left": units*posX[7], "top": units*posY[7]});
        $grid9.css({ "left": units*posX[8], "top": units*posY[8]});
        $grid10.css({ "left": units*posX[9], "top": units*posY[9]});
        $grid11.css({ "left": units*posX[10], "top": units*posY[10]});


        $('.image-grids .rog-inner').css("height", units*height);
        $('.image-grids .rog-inner').css("min-height", units*height);
        $('.image-grids .rog-inner').css("max-height",units*height);
    }
    $('.image-grids .rog-inner').masonry({
        itemSelector: '.image-sub-grid',
        columnWidth: 1
    });
    var hrefAction = false;
    $(".video-block .image-info").on("click", function () {
        if (!(hrefAction)) {
            var cont = $(this).data('iframe');
            cont = cont+'?autoplay=1&output=embed';
            //var iframeStr = cont.replace(/(?:http:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=)?(.+)/g, '<iframe src="http://www.youtube.com/embed/$1" frameborder="0" allowfullscreen></iframe>');
            var iframeStr = cont.replace(/(?:http:\/\/|https:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=)?(.+)/g, '<iframe src="http://www.youtube.com/embed/$1" frameborder="0" allowfullscreen></iframe>');
            var videoBlock = $(this);

            videoBlock.addClass("playing");
            $("body").css("overflow","hidden");
            $(".videoModal .modal-body").html(iframeStr);
            $(".videoModal").modal("show");
            //$(this).append('<div class="rel-video">'+iframeStr+'</div>');

            $(".videoModal").on('hidden.bs.modal', function () {
                videoBlock.removeClass("playing");
                $("body").css("overflow-y","scroll");
            });
        }
        hrefAction = false;
    });
